@prefix rdf: <http://www.w3.org/1999/02/22-rdf-syntax-ns#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .
@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix xsd: <http://www.w3.org/2001/XMLSchema#> .
@prefix atm: <http://www.example.com/atm#> .

atm:ATM rdf:type owl:Class .

atm:_cashWithdrawal rdf:type owl:ObjectProperty ;
    rdfs:domain atm:ATM ;
    rdfs:range xsd:integer ;
    owl:propertyChainAxiom (atm:hasUser atm:hasWithdrawalAmount) ;
    rdfs:comment "This property relates an ATM to the specific amount of cash that a user can withdraw from it."@en .

atm:hasUser rdf:type owl:ObjectProperty ;
    rdfs:range atm:User .

atm:User rdf:type owl:Class .

atm:hasWithdrawalAmount rdf:type owl:DatatypeProperty ;
    rdfs:domain atm:User ;
    rdfs:range xsd:integer ;
    rdfs:comment "This property relates a user to the specific amount of cash that he can withdraw from an ATM."@en .

atm:MultipleOf10 rdf:type owl:Class ;
                rdfs:subClassOf xsd:integer ;
                owl:equivalentClass [
                    rdf:type owl:Restriction ;
                    owl:onProperty atm:hasWithdrawalAmount ;
                    owl:someValuesFrom [
                        a owl:Restriction ;
                        owl:onProperty atm:_cashWithdrawal ;
                        owl:allValuesFrom atm:MultipleOf10
                    ]
                ] ;
    owl:oneOf ( "10"^^xsd:integer "20"^^xsd:integer "30"^^xsd:integer "40"^^xsd:integer "50"^^xsd:integer "60"^^xsd:integer "70"^^xsd:integer "80"^^xsd:integer "90"^^xsd:integer ) ;
    rdfs:comment "This class is a subset of integers that are multiples of 10. The `'oneOf'` enumeration is not exhaustive."@en .
